var findAllPaths = function(root) {
    // res 用来存放所有路径
    const res = [];
    // path 用来存放当前正在遍历的路径
    const path = [];

    const traverse = (root) => {
        if (root === null) {
            return;
        }

        // 前序位置进入节点时，把节点值加入 path
        // @visualize color *root #7ed67e
        path.push(root.val);

        if (root.left === null && root.right === null) {
            // 到达叶子节点，找到一条路径
            // @visualize color *root #6ccff9
            res.push([...path]);
        }

        traverse(root.left);
        traverse(root.right);

        // 后序位置离开节点时，把节点值从 path 中移除
        // @visualize color *root #unset
        path.pop();
    };

    traverse(root);

    return res;
};

